import React, {Component, Fragment} from 'react';
import BoardSquare from "./BoardSquare";


class Board extends Component {
    render() {
        return (
            <div className='grid'>
            <div className='row'>
                <BoardSquare />
                <BoardSquare />
                <BoardSquare />
            </div>
            <div className='row'>
                <BoardSquare />
                <BoardSquare />
                <BoardSquare />
            </div>
            <div className='row'>
                <BoardSquare />
                <BoardSquare />
                <BoardSquare />
            </div>
            </div>
        );
    }
}

export default Board;
